// ==UserScript==
// @name        Delete unused and length zombies
// @namespace   Violentmonkey Scripts
// @match       https://neal.fun/infinite-craft/*
// @grant       unsafeWindow
// @version     1.0
// @author      -
// @description 8/14/2024, 12:02:40 PM
// ==/UserScript==
(function(){
  let explosionAudioSrc=
      "data:audio/mpeg;base64,";

  let gunImg=`data:image/png;base64,`

  function getSave() {
      return new Promise((resolve, reject) => {
          const handleClick = HTMLElement.prototype.click;
          HTMLElement.prototype.click = () => {HTMLElement.prototype.click = handleClick}
          const bodyObserver = new MutationObserver((mutations, observer) => {
              for (const mutation of mutations) {
                  if (mutation.type !== "childList") continue;
                  const anchor = Array.from(mutation.addedNodes).find((node) => node.download === "infinitecraft.json");
                  if (anchor) return fetch(anchor.href).then(resolve);
              }
          });
          bodyObserver.observe(document.body, { childList: true, subtree: true });
          handleClick.call(document.querySelector(".setting[for=import-save] + .setting"));
          setTimeout(() => {
              bodyObserver.disconnect();
              reject("Timed out")
          }, 1500);
      });
  }
  let useCount={}
  function FindUsageCountForAllElement(saveFile)
    {
      useCount={}
      let recipes=saveFile["recipes"];
      for(let key in  recipes)
       {
         for(let recipe of recipes[key])
           {

              if(!useCount[recipe[0].text])
                {
                useCount[recipe[0].text]=1;
                }
                else
                   useCount[recipe[0].text]++;


              if(!useCount[recipe[1].text])
                {
                useCount[recipe[1].text]=1;
                }
                else
                   useCount[recipe[1].text]++;



           }

       }

    }
       async function deleteDeadOrUnused()
    {





      window.alert("We are gonna delete all the dead (length>=30 chars) or unused elements");

         let savefile=await getSave().then(x=>x.json());
         FindUsageCountForAllElement(savefile);

        let copyElm=[...unsafeWindow.$nuxt.$root.$children[2].$children[0].$children[0]._data.elements=unsafeWindow.$nuxt.$root.$children[2].$children[0].$children[0]._data.elements]

         copyElm=copyElm.filter(x=>x.text.length<30 && useCount[x.text]!=null)


         let audio=document.createElement("audio");


         audio.src=explosionAudioSrc;
         audio.volume=.4;

         document.body.appendChild(audio);
         audio.play();





      console.log("after deletion:",copyElm)
      unsafeWindow.$nuxt.$root.$children[2].$children[0].$children[0]._data.elements=copyElm;
      unsafeWindow.$nuxt.$root.$children[2].$children[0].$children[0].saveItems();
    }
  window.addEventListener("load",async ()=>
                         {
                              let img=  document.createElement("img");
                                img.src=gunImg;
                                 img.style.cssText="width: 21px;cursor: pointer;opacity: .8;-webkit-user-select: none;-moz-user-select: none;user-select: none;}"
                                 img.addEventListener("click",()=>{
                                   deleteDeadOrUnused();

                                 })
                                document.querySelector(".side-controls").appendChild(img);


  })



  })();